library flutter_sficon;

import 'package:flutter/widgets.dart';

/// SFIcon is a widget that displays an SF Symbol v6.
/// It is a wrapper around Text widget.
/// It takes an IconData as input and displays the corresponding SF Symbol.
/// Optional parameters: fontSize, fontWeight, color, shadows, textDirection and semanticsLabel.
class SFIcon extends StatelessWidget {
  const SFIcon(
    this.icon, {
    Key? key,
    this.fontSize = 24,
    this.fontWeight = FontWeight.normal,
    this.color,
    this.shadows,
    this.textDirection,
    this.semanticsLabel,
  })  : symbolName = null,
        super(key: key);

  /// Creates an SFIcon from a SF Symbol name (e.g., "sun.cloud.fill").
  /// If the symbol name is not found, a placeholder icon is displayed.
  const SFIcon.fromName(
    String name, {
    Key? key,
    this.fontSize = 24,
    this.fontWeight = FontWeight.normal,
    this.color,
    this.shadows,
    this.textDirection,
    this.semanticsLabel,
  })  : icon = null,
        symbolName = name,
        super(key: key);

  final IconData? icon;
  final String? symbolName;
  final double? fontSize;
  final FontWeight? fontWeight;
  final Color? color;
  final List<Shadow>? shadows;
  final TextDirection? textDirection;
  final String? semanticsLabel;

  @override
  Widget build(BuildContext context) {
    // Resolve icon from symbolName if provided
    final resolvedIcon =
        icon ?? (symbolName != null ? SFIcons.getIconData(symbolName!) : null);

    if (resolvedIcon == null) {
      // Return empty container or placeholder if icon not found
      return const SizedBox.shrink();
    }

    final iconTheme = IconTheme.of(context);
    final textDirection = this.textDirection ?? Directionality.of(context);

    final iconWeight = fontWeight?.value.toDouble() ?? iconTheme.weight;

    final iconOpacity = iconTheme.opacity ?? 1.0;
    var iconColor = color ?? iconTheme.color!;
    if (iconOpacity != 1.0) {
      iconColor = iconColor.withValues(alpha: iconColor.a * iconOpacity);
    }

    return Text(
      String.fromCharCode(resolvedIcon.codePoint),
      textDirection: textDirection,
      semanticsLabel: semanticsLabel,
      style: TextStyle(
        fontVariations: <FontVariation>[
          if (iconWeight != null) FontVariation('wght', iconWeight),
        ],
        inherit: false,
        fontFamily: SFIcons._kFontFamily,
        package: SFIcons._kFontPackage,
        fontSize: fontSize,
        fontWeight: fontWeight,
        color: iconColor,
        shadows: shadows,
      ),
    );
  }
}

